        try container.encodeIfPresent(servePublicCorsAllowedOrigins, forKey: .servePublicCorsAllowedOrigins)
        try container.encodeIfPresent(servePublicCorsEnabled, forKey: .servePublicCorsEnabled)
        try container.encodeIfPresent(updatedAt, forKey: .updatedAt)
    }
}

